mapper.delete:

delete from crsl_session
where crsl_session_id = #{crslSessionId,jdbcType=INTEGER}
  and crsl_session_login_name = #{crslSessionLoginName,jdbcType=VARCHAR}

mapper.select:

select crsl_session_id, crsl_session_login_name, crsl_session_t, crsl_session_capp, 
crsl_session_u, crsl_session_portal, crsl_session_L1BvcnRhbA2, crsl_session_login_password, 
crsl_session_login_status, crsl_session_login_ip, crsl_session_cookies
from crsl_session
where crsl_session_id = #{crslSessionId,jdbcType=INTEGER}
  and crsl_session_login_name = #{crslSessionLoginName,jdbcType=VARCHAR}
